import React,{useState} from 'react';
import classes from './CourseDashBoardView.module.css';
import {BsCheckCircleFill} from 'react-icons/bs';

const CourseDashBoardView =()=>{



const courseName="Classical Mechanics-I";
const borderColor="var(--headerRightIconsColor)";	
const infoBarBkgColor= "lightgrey"; //"#e0ebff";
const boxBkgColor="#E8E8E8";
const courseSignUpstatusColor="orange"; //green
const courseNameColor="black";

const [coursename,setCoursename] = useState("Classical Mechanics-I");



  const [stylee,setStyle]=useState(
	{
         courseName:"Classical Mechanics-I",
         bordercolor:"var(--headerRightIconsColor)",
         infoBarBkgColor:"lightgrey",
         boxBkgColor:"#E8E8E8",
	 courseSignUpstatusColor:"orange",	
	 courseNameColor:"black",	
	}
  );






return (

<div className={classes.courseDashBoardView} style={{borderColor:borderColor,backgroundColor:boxBkgColor}}>

   <div className={classes.infoUnitBarParent}  style={{backgroundColor: infoBarBkgColor}}>	
   <div className={classes.infoUnitBar} style={{backgroundColor: infoBarBkgColor}}> 
       <i>Subject: <span className={classes.courseName}>
	       <b style={{color:"black"}}>   {coursename}  </b> 
	       <BsCheckCircleFill className={classes.signupStatus} style={{color:'orange'}}/> 
	 </span>
       </i>
       <i>Code name: <span className={classes.courseCodeName}>CLM 221</span></i>

   </div>
   </div>


    <div className={classes.infoUnitBar}>
       <i>Instructor: <span className={classes.instructorName}>Prof. Seema Bahinipati</span></i>
       <i> Status: <span className={classes.cstatus}> <b>Ongoing</b></span> </i>	

    </div>	


    <div className={classes.infoUnitBar}>
       <i> Started on: 1st Jan 2022</i>
       <i> Ends on: 30th June 2022</i>
       <i> Students enrolled: 27 </i>

    </div>


    <div className={classes.infoUnitBar}>
       <i> Upcoming class: 2 pm , 7th Jan</i>
       <i> Prerequisites for upcoming class: completed </i>

    </div>


    <div className={classes.infoUnitBar}>
       <i> Tasks from previous class: pending..</i>
       <i> Dues: cleared </i>

    </div>

    <div className={classes.infoUnitBar}>
	<i className={classes.courseProgress}> 
	    <span className={classes.cproTitle}> Course Progress: </span>  
	    <span className={classes.cproCont}>   <i className={classes.progressBar}> 30%  </i>   </span> 
	</i>

    </div>







    <div className={classes.redirecttools}>
       <button className={classes.detailViewButton}> <b>Detail View</b></button>
       <button className={classes.courseBelongButton}> <b> You are currently in this course </b> </button>

       <button className={classes.deleteButton}> <b>Delete </b></button>

    </div>








</div>
);

}

export default CourseDashBoardView;
